# # Can individuals be grouped into distinct clusters based on their weight  and  age?
# This will provide insights of the relationship among health-related factors
# 

# \

# In[ ]:


df_filtered.corr()


# In[ ]:


selected_feature1 = 'edad'

selected_feature2 = 'peso'


# In[ ]:


sns.scatterplot(data=df, x=selected_feature1, y=selected_feature2)


# In[ ]:


from sklearn.cluster import KMeans
num_clusters = 2
Kmean = KMeans(n_clusters=num_clusters)
Kmean.fit(df[[selected_feature1, selected_feature2]])


# In[ ]:


type(Kmean)


# In[ ]:


Kmean.cluster_centers_


# In[ ]:


Kmean.labels_


# In[ ]:


X = df[[selected_feature1, selected_feature2]]


# In[ ]:


plt.scatter(data=X, x=selected_feature1, y=selected_feature2)
plt.xlabel('Age')
plt.ylabel('Weight')
colors = ['r', 'y', 'b', 'g']
for i, coor in enumerate(Kmean.cluster_centers_):
    plt.scatter(coor[0], coor[1], s=200, c=colors[i], marker='s')


# Silhouette Score is a metric used to evaluate the quality of a clustering algorithm. It provides a measure of how well-defined and distinct the clusters are in your data

# In[ ]:


from sklearn.metrics import silhouette_score
df_filtered['cluster_label'] = KMeans(n_clusters=2).fit_predict(X)
X = df_filtered.drop(columns=['cluster_label'])
cluster_labels = df_filtered['cluster_label']
silhouette_avg = silhouette_score(X, cluster_labels)
print(f"Silhouette Score: {silhouette_avg}")


# A silhouette score of 0.7311 suggests a strong level of separation, indicating that the clusters are well-separeted. If the result were closer to 1, it would have indicated a better-defined and more separated clustering solution

